CREATE TABLE `synonym_category` (
	`cat_no` BIGINT(10) NOT NULL AUTO_INCREMENT COMMENT '카테고리 번호',
	`first_cat_name` VARCHAR(100) NOT NULL DEFAULT '' COMMENT '1depth 카테고리 명',
	`second_cat_name` VARCHAR(100) NOT NULL DEFAULT '' COMMENT '2depth 카테고리 명',
	`third_cat_name` VARCHAR(100) NOT NULL DEFAULT '' COMMENT '3depth 카테고리 명',
	`fourth_cat_name` VARCHAR(100) NOT NULL DEFAULT '' COMMENT '4depth 카테고리 명',
	`same_words` VARCHAR(200) NOT NULL DEFAULT '' COMMENT '동의어',
	`similar_words` VARCHAR(200) NOT NULL DEFAULT '' COMMENT '유의어',
	`weight` DOUBLE NOT NULL DEFAULT 0.0 COMMENT '가중치',
	`availability` BOOLEAN NOT NULL DEFAULT TRUE COMMENT '사용 여부',
	`worker` VARCHAR(100) NOT NULL DEFAULT "sys" COMMENT '작업자',
	`work_date` TIMESTAMP NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '작업 일시',
	PRIMARY KEY (`cat_no`)
)
COMMENT='카테고리 정보 simple'
COLLATE='utf8_general_ci'
ENGINE=InnoDB
AUTO_INCREMENT=43140001
;

